// src/pages/ProductListPage.js
import React from 'react';
import ProductCard from '../components/productcard'; // Verifica el nombre del archivo

const ProductListPage = () => {
  const products = [
    { id: 1, nombre: 'Planta A', precio: 10, imagen: 'path/to/imageA.jpg', categoria: 'Interior' },
    { id: 2, nombre: 'Planta B', precio: 15, imagen: 'path/to/imageB.jpg', categoria: 'Exterior' },
    { id: 3, nombre: 'Planta C', precio: 20, imagen: 'path/to/imageC.jpg', categoria: 'Sucia' },
    // Agrega más productos aquí
  ];

  return (
    <div>
      <h2>Lista de Productos</h2>
      <div className="product-list">
        {products.map(product => (
          <ProductCard key={product.id} product={product} />
        ))}
      </div>
    </div>
  );
};

export default ProductListPage;
